import {Outlet, Link } from "react-router-dom";
import "../styles.css";

const SwitchPages = ({pickerIsActive, standupIsActive}) =>{
    return(
        <div>
            <nav className="SwitchPages">
        <ul>
          <li className={`${pickerIsActive ? "active" : "inactive"}`}>
            <Link to="/">Random Picker</Link>
          </li>
          <li className={`${standupIsActive ? "active" : "inactive"}`}>
            <Link to="/standup">Standup Lead</Link>
          </li>
        </ul>
      </nav>
      <Outlet />
        </div>
    )
}

export default SwitchPages
